import { MostEpulProvider } from './components/MostEpulContext';

const App = props => {
  return (
    <div className="App">
      <Header />
      <ReferenceProvider>
      <MostEpulProvider>
      <Routes>
            <Route exact path='/' element={<Main />}/>
        </Routes>
      </MostEpulProvider>
      </ReferenceProvider>
      <Footer />
    </div>
  );
}

export default App;
